INSERT INTO `products` VALUES (1,'iPhone 11 Pro','The iPhone 11 Pro and iPhone 11 Pro Max are smartphones designed, developed and marketed by Apple Inc. They are the 13th-generation flagship iPhones, succeeding the iPhone XS and iPhone XS Max, respectively. Apple CEO Tim Cook unveiled the devices alongside a lower-end model, the iPhone 11, on September 10, 2019, at the Steve Jobs Theater at Apple Park. Pre-orders began on September 13, 2019, and the phones went on sale on September 20.[5] They were discontinued on October 13, 2020, following the announcement of iPhone 12 Pro and iPhone 12 Pro Max.','data:image/jpeg;base64,',1100,800,1),(2,'iPhone 11 Pro Max','The iPhone 11 Pro and iPhone 11 Pro Max are smartphones designed, developed and marketed by Apple Inc. They are the 13th-generation flagship iPhones, succeeding the iPhone XS and iPhone XS Max, respectively. Apple CEO Tim Cook unveiled the devices alongside a lower-end model, the iPhone 11, on September 10, 2019, at the Steve Jobs Theater at Apple Park. Pre-orders began on September 13, 2019, and the phones went on sale on September 20.[5] They were discontinued on October 13, 2020, following the announcement of iPhone 12 Pro and iPhone 12 Pro Max.','https://anhducdigital.vn/media/product/7824_iphone_11_pro_max_midnight_green.jpg',1250,880,1),(3,'iPad Air','The iPad Air is a tablet computer designed, developed, and marketed by Apple Inc. It was announced on October 22, 2013, and was released on November 1, 2013. Part of the iPad line of tablet computers, the iPad Air features a thinner design than its predecessors with similarities to the contemporaneous iPad Mini 2.\r\nIts successor, the iPad Air 2, was announced on October 16, 2014.\r\nIt was discontinued on March 21, 2016.[citation needed]\r\nOperating system support for the iPad Air lasted until iOS 12, which was the final version to support the device.','https://bizweb.dktcdn.net/100/116/615/products/ipad-air-select-wifi-green-202009.png?v=1600463175000',1000,650,2),(4,'iPad Pro','The iPad Pro is a line of iPad tablet computers designed, developed, and marketed by Apple Inc. and first available in November 2015. They run the iOS and iPadOS mobile operating systems. The current generation is available in two screen sizes, 11-inch (28 cm) and 12.9-inch (33 cm),[12] each with four options for internal NVMe storage capacities: 128 GB, 256 GB, 512 GB, and 1 TB','https://store.storeimages.cdn-apple.com/4982/as-images.apple.com/is/ipad-pro-12-select-wifi-spacegray-202003_FMT_WHH?wid=940&hei=1112&fmt=png-alpha&qlt=80&.v=1583553704156',1300,950,2),(5,'Samsung Galaxy Note 10','The Samsung Galaxy Note 10 (stylized as Samsung Galaxy Note10) is a line of Android-based phablets designed, developed, produced, and marketed by Samsung Electronics as part of the Samsung Galaxy Note series. They were unveiled on 7 August 2019, as the successors to the Samsung Galaxy Note 9.[2] Details about the phablets were widely leaked in the months leading up to the phablets\' announcement.[3]','https://images.samsung.com/ph/smartphones/galaxy-note10/images/galaxy-note10_highlights_mobile_kv.jpg',600,380,1),(6,'Samsung J7','Samsung Galaxy J7 is a mid range Android smartphone produced by Samsung Electronics in 2015','https://www.gizmochina.com/wp-content/uploads/2019/02/Samsung-Galaxy-J7-TopA10-600x540.jpeg',400,180,1),(7,'Dell XPS','Dell XPS (\"eXtreme Performance System\") is a line of consumer-oriented high-end laptop and desktop computers manufactured by Dell','https://khoaquan.vn/wp-content/uploads/2019/12/637092404010389299_dell-xps-15-7590-bac-1.jpg',900,750,3),(8,'Macbook Pro 13 inch','The MacBook Pro is a line of Macintosh portable computers introduced in January 2006 by Apple Inc. It is the higher-end model of the MacBook family, sitting above the consumer-focused MacBook Air, and is sold with 13- and 16-inch screens. A 17-inch version was sold from April 2006 to June 2012.','https://laptopvang.com/wp-content/uploads/2019/07/macbook-pro-2019-13inch-gray.jpg',1300,950,3),(9,'Macbook Pro 16inch','The MacBook Pro is a line of Macintosh portable computers introduced in January 2006 by Apple Inc. It is the higher-end model of the MacBook family, sitting above the consumer-focused MacBook Air, and is sold with 13- and 16-inch screens. A 17-inch version was sold from April 2006 to June 2012.','https://mac365.vn/wp-content/uploads/2019/11/macbook-pro-16inch-2019-silver-laptopvang.com_.jpg',2600,2200,3),(11,'Surface Pro 3','The Surface Pro 3 is the third-generation Surface-series 2-in-1 detachable, designed, developed, marketed, and produced by Microsoft. It originally ran the Windows 8 Pro operating system (OS), but the optional upgrade to Windows 10 Pro (OS) operating system was later added.','http://cdn.shopify.com/s/files/1/0047/0620/5760/products/e10cc7_2340b05f065b4aba96e052d32ca3d28a_mv2_2a3bd019-3edf-4503-9c8f-8c0c580f4db1_1200x1200.jpg?v=1603102048',1400,1100,2),(12,'Apple Watch 42mm','Apple Watch is a line of smartwatches produced by Apple Inc. It incorporates fitness tracking, health-oriented capabilities, and wireless telecommunication, and integrates with iOS and other Apple products and services','data:image/jpeg;base64,',600,380,7),(13,'Apple watch 38mm','Apple Watch is a line of smartwatches produced by Apple Inc. It incorporates fitness tracking, health-oriented capabilities, and wireless telecommunication, and integrates with iOS and other Apple products and services','',499,350,7),(30,'Dell XPS 13 2020','Dell XPS (\"eXtreme Performance System\") is a line of consumer-oriented high-end laptop and desktop computers manufactured by Dell','data:image/jpeg;base64,',1600,1300,3);
